import axios from 'axios';

const restaurant = () => {
    axios.get(`https://cors-anywhere.herokuapp.com/
    https://api.yelp.com/v3/businesses/search?location=NYC`, {
        headers: {

            Authorization: `Bearer ${process.env.REACT_APP_API_KEY}`

        }, params: {
            categories: 'mexican'

        }}).then((res) => {
            console.log(res.data)
        }).catch((err) => {
            console.log(err)
        })



